import Bloglist from './Bloglist';


const Home = () => {

    const [blogs, setBlogs] = useState(null);

 const handleDelete = (id) => {
    const newBlogs = blogs.filter(blog => blog.id !== id);
    setBlogs(newBlogs);
 }

useEffect(() => {
    fetch('http://localhost:8000/blogs')
        .then(res => {
            return res.json();
        })


}, []);

    return (
        <div className="home">           
            <Bloglist blogs={blogs.filter((blog) => blog.authour === 'yoshi')} title="Yoshi's blogs!" handleDelete={handleDelete}/>
            <Bloglist blogs={blogs.filter((blog) => blog.authour === 'mario')} title="Mario's blogs!" handleDelete={handleDelete}/>

        </div>
    )
}

export default Home
